INSERT INTO `bh_kienthuc` (`maso`, `tieude`, `slug`, `noidung`, `lienquan`, `ngaylam`) VALUES
(1, 'Khái niệm số nguyên tố', 'khai-niem-so-nguyen-to', '<p><strong>* Định nghĩa:</strong></p>\r\n\r\n<p>Số tự nhiên n &gt; 1 được gọi là số nguyên tố nếu nó chỉ có 2 ước số dương là 1 và n.</p>\r\n\r\n<p><strong>* Ví dụ:</strong></p>\r\n\r\n<p>+ Các số 2, 3, 5, 7 là số nguyên tố.</p>\r\n\r\n<p>+ Số 4 không phải là số nguyên tố vì 4 có thêm ước là 2.</p>\r\n', '2', '2014-11-23 05:29:39'),
(2, 'Thuật toán kiểm tra số nguyên tố', 'thuat-toan-kiem-tra-so-nguyen-to', '<p><strong>Thuật toán tìm số nguyên tố:</strong></p>\r\n\r\n<p>* Thuật toán 1:</p>\r\n\r\n<p>+ Ý tưởng: Nếu n không chia hết cho số nào từ 2 đến n/2 thì n là số nguyên tố.</p>\r\n\r\n<p>+ Thuật toán:</p>\r\n\r\n<p>Với mỗi i đếm từ 2 đến n div 2: nếu n chia hết cho i thì n không phải là số nguyên tố.</p>\r\n\r\n<p>* Thuật toán 2:</p>\r\n\r\n<p>+ Ý tưởng: Nếu n không chia hết cho số nào từ 2 đến (căn bậc hai của n) thì n là số nguyên tố.</p>\r\n\r\n<p>+ Thuật toán:</p>\r\n\r\n<p>Với mỗi i đếm từ 2 đến sqrt(n): nếu n chia hết cho i thì n không phải là số nguyên tố</p>\r\n', '1', '2014-11-14 09:43:20'),
(3, 'Ước số - bội số', 'uoc-so-boi-so', '<p><strong>*Khái niệm:</strong></p>\r\n\r\n<p>Nếu a chia hết cho b thì ta nói a là bội số của b, và b là ước số của a.</p>\r\n\r\n<p>Đôi khi, ta còn gọi tắt là bội, ước.</p>\r\n', '', '2014-11-14 10:30:32'),
(4, 'Chia hết, chia hết cho', 'chia-het-va-chia-het-cho', '<p>* Khái niệm:</p>\r\n\r\n<p>Cho 2 số nguyên a, b (b &ne; 0). Nếu tồn tại số nguyên k sao cho a = b.k thì ta nói a <em>chia hết cho</em> b (kí hiệu a ⁞ b), hoặc b <em>chia hết</em> a (kí hiệu b | a).</p>\r\n\r\n<p>* Tính chất cơ bản:</p>\r\n\r\n<ul>\r\n	<li>a ⁞ a với mọi a &ne; 0</li>\r\n	<li>a ⁞ 1 với mọi a</li>\r\n	<li>Nếu a ⁞ b và b ⁞ c thì a ⁞ c</li>\r\n	<li>Nếu a ⁞ b và b ⁞ a thì a = b hoặc a =&nbsp; -b</li>\r\n	<li>&nbsp;</li>\r\n</ul>\r\n', '', '2014-11-23 05:43:51'),
(5, 'Cơ bản về Pascal', 'co-ban-ve-pascal', '<p><strong>* Kiểu dữ liệu:</strong></p>\r\n\r\n<p>- Kiểu số nguyên: byte, integer, word, longint</p>\r\n\r\n<p>- Kiểu số thực: real</p>\r\n\r\n<p>- Kiểu kí tự: char, string</p>\r\n\r\n<p>- Kiểu logic: boolean</p>\r\n\r\n<p><strong>* Các câu lệnh cơ bản</strong></p>\r\n\r\n<p>- Lệnh gán giá trị cho biến; vd x:= 1;</p>\r\n\r\n<p>- Lệnh&nbsp; nhập giá trị cho biến; vd readln(x);</p>\r\n\r\n<p>- Lệnh xuất giá trị cho biến; write(x);</p>\r\n\r\n<p>- Lệnh điều kiện if, case</p>\r\n\r\n<p>- Lệnh lặp: for, while, repeat</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '2014-11-23 07:04:17');
