(2, 'chia hết', 'bh.php?b=chia-het-va-chia-het-cho', '2014-11-23 06:55:12'),
(3, 'số nguyên tố', 'bh.php?b=khai-niem-so-nguyen-to', '2014-11-23 06:56:01');
INSERT INTO `th_baitap` (`maso`, `mamuc`, `tieude`, `noidung`, `nopbai`, `ngaylam`) VALUES
(1, 'tin11', 'Bài tập và thực hành số 5', '<p>Làm bài tập và thực hành <strong>SGK</strong></p>\n', 0, '2014-11-12 15:01:30'),
(2, 'hsg4', 'Chia nhóm học sinh (bài 2, hsg 12 Bình Định 2014)', '<p><strong><em>Thi học sinh giỏi </em></strong></p>\r\n\r\n<p>Trong kì thi học sinh giỏi lớp 12 cấp tỉnh năm 2014 tại tỉnh Bình Định có N học sinh đến từ các trường THPT trong tỉnh. Giả sử tên các học sinh dự thi là không trùng nhau. Ban đầu ta biết một số thông tin về những học sinh cùng trường với nhau theo từng cặp. Hãy xác định số trường có học sinh dự thi và danh sách tên các học sinh dự thi của từng trường. Giả sử thông tin về các cặp học sinh cùng trường đủ cho ta xác định đúng các học sinh trong cùng một trường.</p>\r\n\r\n<p>Tên chương trình <strong>ThiHSG.PAS</strong></p>\r\n\r\n<p><strong><u>Dữ liệu vào:</u></strong> file <strong>ThiHSG.inp</strong> có cấu trúc như sau:</p>\r\n\r\n<p>Dòng đầu là hai số nguyên dương N, M với N là số học sinh tham gia thi học sinh giỏi và M là số thông tin những cặp học sinh cùng trường (0</p>\r\n\r\n<p>M dòng tiếp theo mỗi dòng là tên của hai học sinh cùng trường với nhau hoặc tên của một học sinh nếu trường đó chỉ có một học sinh dự thi.</p>\r\n\r\n<p><strong><u>Dữ liệu ra:</u></strong> file <strong>ThiHSG.out</strong> có cấu trúc như sau:</p>\r\n\r\n<p>Dòng đầu là số nguyên dương K là số trường có học sinh dự thi.</p>\r\n\r\n<p>K dòng tiếp theo, mỗi dòng gồm tên những học sinh của cùng một trường dự thi, giữa tên các học sinh cách nhau một khoảng cách.</p>\r\n\r\n<p>Ví dụ:</p>\r\n\r\n<table border="1" cellpadding="0" cellspacing="0">\r\n	<tbody>\r\n		<tr>\r\n			<td style="width:312px">\r\n			<p>ThiHSG.inp</p>\r\n			</td>\r\n			<td style="width:312px">\r\n			<p>ThiHSG.out</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:312px">\r\n			<p>10 8</p>\r\n\r\n			<p>An Binh</p>\r\n\r\n			<p>Thu Sinh</p>\r\n\r\n			<p>An Sinh</p>\r\n\r\n			<p>Lan Hoa</p>\r\n\r\n			<p>Tam</p>\r\n\r\n			<p>Hoa Linh</p>\r\n\r\n			<p>Lan Hung</p>\r\n\r\n			<p>Lan Khanh</p>\r\n			</td>\r\n			<td style="width:312px" valign=''top''>\r\n			<p>3</p>\r\n\r\n			<p>An Binh Sinh Thu</p>\r\n\r\n			<p>Hoa Hung Khanh Lan Linh</p>\r\n\r\n			<p>Tam</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', 1, '2014-11-13 16:40:11'),
(3, 'hsg4', 'Sắp xếp nhanh', '<p>Cho dãy số A1, A2, ... An.</p>\n\n<p>Hãy thực hiện sắp xếp nhanh cho dãy số trên.</p>\n', 1, '2014-11-13 16:42:28'),
(4, 'hsg0', 'Bài tập pascal cơ bản', '<p style="margin-left:7.1pt">Bài 1.Nhập vào 2 cạnh của một hình chữ nhật. In ra màn hình diện tích và chu vi của nó.</p>\r\n\r\n<p style="margin-left:7.1pt">Bài 2.Nhập vào bán kính của hình tròn. In ra màn hình diện tích và chu vi của nó.</p>\r\n\r\n<p style="margin-left:7.1pt">Bài 3.<strong><em>Tính tam</em></strong> <strong><em>giác</em></strong>: Nhập vào ba số a,b,c bất kì. Kiểm tra xem nó có thể là độ dài ba cạnh hay không, nếu không thì in ra màn hình &#39;Khong la ba canh cua mot tam giac&#39;. Ngược lại, thì in diện tích, chu vi của tam giác ra màn hình.</p>\r\n\r\n<p style="margin-left:7.1pt">Bài 4.Viết chương trình giải phương trình bậc 1 (ax + b = 0)</p>\r\n\r\n<p style="margin-left:7.1pt">Bài 5.Viết chương trình giải phương trình bậc 2 (ax2&nbsp;+ bx + c =0)</p>\r\n\r\n<p style="margin-left:7.1pt">Bài 6.Tìm giá trị nhỏ nhất trong 4 số a, b, c, d (a, b, c, được nhập từ bàn phím).</p>\r\n\r\n<p style="margin-left:7.1pt">Bài 7.Nhập vào thời gian 1 công việc nào đó là x giây. Hãy chuyển đổi và viết ra màn hình số thời gian trên dưới dạng bằng bao nhiêu giờ, bao nhiêu phút, bao nhiêu giây.</p>\r\n\r\n<p style="margin-left:7.1pt">Bài 8.Nhập vào tâm và bán kính của một đường tròn. Sau đó nhập vào một điểm A(x, y) bất kì và kiểm tra xem nó có thuộc đường tròn hay không?</p>\r\n\r\n<p style="margin-left:7.1pt">Bài 9.Tính n!</p>\r\n\r\n<p style="margin-left:7.1pt">Bài 10.Tìm tất cả các chữ số có ba chữ số abc sao cho tổng các lập phương của các chữ số thì bằng chính số đó:</p>\r\n\r\n<p style="margin-left:3.3pt"><img src="file:///C:\\Users\\NAMTRA~1\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image002.gif" style="height:23px; width:113px" /></p>\r\n\r\n<p style="margin-left:7.1pt">Bài 11.Nhập vào một số nguyên không âm, kiểm tra xem nó có phải là số nguyên tố hay không ?</p>\r\n\r\n<p style="margin-left:7.1pt">Bài 12.In ra các số nguyên tố nhỏ hơn hoặc bằng N (N là số nguyên không âm được nhập từ bàn phím).</p>\r\n\r\n<p style="margin-left:7.1pt">Bài 13.Nhập 3 loại tiền và số tiền cần đổi. Hãy tìm tất cả các tổ hợp có được của 3 loại tiền trên cho số tiền vừa nhập.</p>\r\n\r\n<p style="margin-left:7.1pt">Bài 14.Lập trình giải bài toán sau:</p>\r\n\r\n<p style="margin-left:2.0cm">Trăm trâu trăm cỏ</p>\r\n\r\n<p style="margin-left:2.0cm">Trâu đứng ăn năm</p>\r\n\r\n<p style="margin-left:2.0cm">Trâu nằm ăn ba</p>\r\n\r\n<p style="margin-left:2.0cm">Trâu già ba con một bó. Hỏi có bao nhiêu con mỗi loại?</p>\r\n\r\n<p style="margin-left:7.1pt">Bài 15.Tạo bảng số dạng sau:</p>\r\n\r\n<table border="1" cellpadding="0" cellspacing="0">\r\n	<tbody>\r\n		<tr>\r\n			<td style="width:55px">\r\n			<p style="margin-left:3.3pt">0</p>\r\n			</td>\r\n			<td style="width:58px">\r\n			<p style="margin-left:3.3pt">1</p>\r\n			</td>\r\n			<td style="width:58px">\r\n			<p style="margin-left:3.3pt">2</p>\r\n			</td>\r\n			<td style="width:58px">\r\n			<p style="margin-left:3.3pt">3</p>\r\n			</td>\r\n			<td style="width:57px">\r\n			<p style="margin-left:3.3pt">4</p>\r\n			</td>\r\n			<td style="width:57px">\r\n			<p style="margin-left:3.3pt">5</p>\r\n			</td>\r\n			<td style="width:57px">\r\n			<p style="margin-left:3.3pt">6</p>\r\n			</td>\r\n			<td style="width:57px">\r\n			<p style="margin-left:3.3pt">7</p>\r\n			</td>\r\n			<td style="width:57px">\r\n			<p style="margin-left:3.3pt">8</p>\r\n			</td>\r\n			<td style="width:57px">\r\n			<p style="margin-left:3.3pt">9</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:55px">\r\n			<p style="margin-left:3.3pt">10</p>\r\n			</td>\r\n			<td style="width:58px">\r\n			<p style="margin-left:3.3pt">11</p>\r\n			</td>\r\n			<td style="width:58px">\r\n			<p style="margin-left:3.3pt">12</p>\r\n			</td>\r\n			<td style="width:58px">\r\n			<p style="margin-left:3.3pt">13</p>\r\n			</td>\r\n			<td style="width:57px">\r\n			<p style="margin-left:3.3pt">14</p>\r\n			</td>\r\n			<td style="width:57px">\r\n			<p style="margin-left:3.3pt">15</p>\r\n			</td>\r\n			<td style="width:57px">\r\n			<p style="margin-left:3.3pt">16</p>\r\n			</td>\r\n			<td style="width:57px">\r\n			<p style="margin-left:3.3pt">17</p>\r\n			</td>\r\n			<td style="width:57px">\r\n			<p style="margin-left:3.3pt">18</p>\r\n			</td>\r\n			<td style="width:57px">\r\n			<p style="margin-left:3.3pt">19</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style="margin-left:7.1pt">Bài 16.&nbsp;Tạo bảng số vuông nxn theo dạng sau:</p>\r\n\r\n<table border="1" cellpadding="0" cellspacing="0">\r\n	<tbody>\r\n		<tr>\r\n			<td style="width:41px">\r\n			<p style="margin-left:3.3pt">1</p>\r\n			</td>\r\n			<td style="width:41px">\r\n			<p style="margin-left:3.3pt">2</p>\r\n			</td>\r\n			<td style="width:41px">\r\n			<p style="margin-left:3.3pt">3</p>\r\n			</td>\r\n			<td style="width:41px">\r\n			<p style="margin-left:3.3pt">4</p>\r\n			</td>\r\n			<td style="width:41px">&nbsp;</td>\r\n			<td style="width:41px">&nbsp;</td>\r\n			<td style="width:41px">&nbsp;</td>\r\n			<td style="width:41px">&nbsp;</td>\r\n			<td style="width:41px">&nbsp;</td>\r\n			<td style="width:41px">&nbsp;</td>\r\n			<td style="width:41px">&nbsp;</td>\r\n			<td style="width:41px">&nbsp;</td>\r\n			<td style="width:41px">&nbsp;</td>\r\n			<td style="width:41px">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:41px">\r\n			<p style="margin-left:3.3pt">8</p>\r\n			</td>\r\n			<td style="width:41px">\r\n			<p style="margin-left:3.3pt">7</p>\r\n			</td>\r\n			<td style="width:41px">\r\n			<p style="margin-left:3.3pt">6</p>\r\n			</td>\r\n			<td style="width:41px">\r\n			<p style="margin-left:3.3pt">5</p>\r\n			</td>\r\n			<td style="width:41px">&nbsp;</td>\r\n			<td style="width:41px">&nbsp;</td>\r\n			<td style="width:41px">&nbsp;</td>\r\n			<td style="width:41px">&nbsp;</td>\r\n			<td style="width:41px">&nbsp;</td>\r\n			<td style="width:41px">&nbsp;</td>\r\n			<td style="width:41px">&nbsp;</td>\r\n			<td style="width:41px">&nbsp;</td>\r\n			<td style="width:41px">&nbsp;</td>\r