(164, 11, 3, 10, 1, 1, 'Câu lệnh sau có ý nghĩa gì?[pre]For u:=1 to n do[br]    if u mod 3 = 0 then[br]        write(u);[/pre] ', 1, '2014-12-07 09:38:42'),
(165, 11, 3, 10, 1, 1, 'Câu lệnh sau có ý nghĩa gì?[pre]For u:=1 to n do[br]    if u mod 2 = 0 then[br]        write(u);[/pre] ', 1, '2014-12-07 09:39:12'),
(166, 11, 3, 10, 1, 1, 'Câu lệnh sau có ý nghĩa gì?[pre]For u:=1 to n do[br]    if u mod 2 <> 0 then[br]        write(u);[/pre] ', 1, '2014-12-07 09:39:49'),
(167, 11, 3, 10, 1, 1, 'Câu lệnh sau có ý nghĩa gì?[pre]For u:=1 to n do[br]    if u mod 2 > 0 then[br]        write(u);[/pre] ', 1, '2014-12-07 09:40:33'),
(168, 11, 3, 10, 1, 1, 'Câu lệnh sau có ý nghĩa gì?[pre]For u:=1 to n do[br]    if u mod 2 = 1 then[br]        write(u);[/pre] ', 1, '2014-12-07 09:40:53'),
(169, 11, 3, 10, 1, 1, 'Câu lệnh sau có ý nghĩa gì?[pre]For u:=1 to n do[br]    if u mod 2 < 1 then[br]        write(u);[/pre] ', 1, '2014-12-07 09:41:24'),
(170, 11, 4, 11, 1, 1, 'Với khai báo mảng nào sau đây đúng cú pháp?', 1, '2014-12-07 09:57:44'),
(171, 11, 4, 11, 1, 1, 'Để tính tổng n phần tử của mảng A, một HS viết lệnh như sau:\r\n[pre]S:=0;[br]For i:= 1 to n do S:= S-A[i];[/pre]\r\nCâu lệnh tiếp theo nào sẽ viết đúng giá trị cần tính?', 1, '2014-12-07 10:15:46'),
(172, 11, 4, 11, 1, 1, 'Để tính tổng n phần tử của mảng A, một HS viết lệnh như sau:\r\n[pre]S:=1;[br]For i:= 1 to n do S:= S+A[i];[/pre]\r\nCâu lệnh tiếp theo nào sẽ viết đúng giá trị cần tính?', 1, '2014-12-07 10:26:08'),
(173, 11, 4, 11, 1, 1, 'Để tính tổng n phần tử của mảng A, một HS viết lệnh như sau:\r\n[pre]S:=1;[br]For i:= 1 to n do S:= S-A[i];[/pre]\r\nCâu lệnh tiếp theo nào sẽ viết đúng giá trị cần tính?', 1, '2014-12-07 10:27:05'),
(174, 11, 3, 10, 1, 1, 'Câu lệnh [code]for k:= 3 to 1 do write(''O'');[/code] sẽ viết ra những gì?', 1, '2014-12-07 10:29:03'),
(175, 11, 3, 10, 1, 1, 'Sau khi thực hiện đoạn chương trình sau thì giá trị của biến s như thế nào? Biết n là một số nguyên dương.\r\n[pre]\r\ns:=0; \r\ni:=1;\r\nwhile (i<=n) do s:=s+i; i:=i+1;\r\n[/pre]\r\n', 1, '2014-12-07 10:35:15'),
(176, 11, 3, 10, 1, 1, 'Sau khi thực hiện đoạn chương trình sau thì giá trị của biến s như thế nào? Biết n là một số nguyên dương.\r\n[pre]\r\ns:=0; \r\ni:=1;\r\nwhile (i<=n) do begin s:=s+i; i:=i+1; end;\r\n[/pre]\r\n', 1, '2014-12-07 10:37:46'),
(177, 11, 3, 10, 1, 1, 'Sau khi thực hiện đoạn chương trình sau thì giá trị của biến s như thế nào? Biết n là một số nguyên dương.\r\n[pre]\r\ns:=0; \r\ni:=1;\r\nwhile (i<=n) do begin s:=s+1; i:=i+1; end;\r\n[/pre]\r\n', 1, '2014-12-07 10:42:26'),
(178, 11, 3, 10, 1, 1, 'Sau khi thực hiện đoạn chương trình sau thì giá trị của biến s như thế nào? Biết n là một số nguyên dương.\r\n[pre]\r\ns:=0; \r\ni:=1;\r\nwhile (i<=n) do begin s:=s*i; i:=i+1; end;\r\n[/pre]\r\n', 1, '2014-12-07 10:41:48'),
(179, 11, 3, 10, 1, 1, 'Sau khi thực hiện đoạn chương trình sau thì giá trị của biến [i]lt[/i] là gì?\r\n[pre]\r\nlt:=1;\r\nfor i:= 1 to b do lt:=lt*a;\r\n[/pre]', 1, '2014-12-07 11:03:43'),
(180, 11, 3, 10, 1, 1, 'Sau khi thực hiện đoạn chương trình sau thì giá trị của biến [i]lt[/i] là gì?\r\n[pre]\r\nlt:=a;\r\nfor i:= 1 to b do lt:=lt*a;\r\n[/pre]', 1, '2014-12-07 11:03:57'),
(181, 11, 3, 10, 1, 1, 'Sau khi thực hiện đoạn chương trình sau thì giá trị của biến [i]lt[/i] là gì?\r\n[pre]\r\nlt:=1;\r\nfor i:= 1 to a do lt:=lt*b;\r\n[/pre]', 1, '2014-12-07 11:04:09'),
(182, 11, 3, 10, 1, 1, 'Sau khi thực hiện đoạn chương trình sau thì giá trị của biến [i]lt[/i] là gì?\r\n[pre]\r\nlt:=0;\r\nfor i:= 1 to b do lt:=lt+a;\r\n[/pre]', 1, '2014-12-07 11:04:23'),
(183, 11, 3, 10, 1, 1, 'Câu lệnh [code]For t:= 2 to 5 do write(''B'');[/code] sẽ viết ra những gì?', 1, '2014-12-07 11:07:02'),
(184, 11, 3, 10, 1, 1, 'Câu lệnh [code]For t:= 2 downto 5 do write(''B'');[/code] sẽ viết ra những gì?', 1, '2014-12-07 11:08:05'),
(185, 11, 3, 10, 1, 1, 'Câu lệnh [code]For t:= 5 downto 2 do write(''B'');[/code] sẽ viết ra những gì?', 1, '2014-12-07 11:08:47'),
(186, 11, 3, 10, 1, 1, 'Câu lệnh [code]For t:= 5 to 2 do write(''B'');[/code] sẽ viết ra những gì?', 1, '2014-12-07 11:09:10'),
(187, 11, 3, 10, 1, 1, 'Câu lệnh [code]For y:= 3 to 3 do write(''A''); [/code] sẽ viết ra những gì?', 1, '2014-12-07 11:10:26'),
(188, 11, 3, 10, 1, 1, 'Câu lệnh [code]For y:= 3 to 3 do write(''AA''); [/code] sẽ viết ra những gì?', 1, '2014-12-07 11:12:27'),
(189, 11, 3, 10, 1, 1, 'Câu lệnh [code]For y:= 3 to 3 do write(''AAA''); [/code] sẽ viết ra những gì?', 1, '2014-12-07 11:13:06'),
(190, 11, 3, 10, 1, 1, 'Câu lệnh [code]For y:= 3 to 3 do write(''B''); [/code] sẽ viết ra những gì?', 1, '2014-12-07 11:14:23'),
(191, 11, 3, 9, 1, 1, 'Khi thực hiện câu lệnh [code]if x>1 then y:=2 else y:=1;[/code] nếu x mang giá trị 1 thì y sẽ bằng bao nhiêu?', 1, '2014-12-07 12:51:10'),
(192, 11, 3, 9, 1, 1, 'Khi thực hiện câu lệnh [code]if x>=1 then y:=2 else y:=1;[/code] nếu x mang giá trị 1 thì y sẽ bằng bao nhiêu?', 1, '2014-12-07 12:51:28'),
(193, 11, 3, 9, 1, 1, 'Sau khi thực hiện câu lệnh [code]if x>=1 then y:=2 else y:=1;[/code] thì y bằng 1. Vậy x có thể bằng bao nhiêu?', 1, '2014-12-07 12:51:37'),
(194, 11, 3, 9, 1, 1, 'Sau khi thực hiện câu lệnh [code]if x>1 then y:=2 else y:=1;[/code] thì y bằng 2. Vậy x có thể bằng bao nhiêu?', 1, '2014-12-07 12:51:48'),
(195, 11, 3, 9, 1, 1, 'Bộ ba số (a, b, c) là [i]bộ số Pi-ta-go[/i] nếu tổng bình phương của 2 số bằng bình phương của số còn lại. Câu lệnh nào sau đây để kiểm tra bộ số Pi-ta-go?', 1, '2014-12-07 12:56:52'),
(196, 11, 3, 9, 1, 1, '[i]Năm nhuận[/i] là năm chia hết cho 400 hoặc chia hết cho 4 nhưng không chia hết cho 100. Câu lệnh nào sau đây để kiểm tra năm N có nhuận hay không?', 1, '2014-12-07 13:24:07'),
(197, 11, 3, 9, 1, 1, '[i]Năm nhuận[/i] là năm chia hết cho 400 hoặc chia hết cho 4 nhưng không chia hết cho 100. Câu lệnh nào sau đây để kiểm tra năm N có nhuận hay không?', 1, '2014-12-07 13:33:40'),
(198, 11, 3, 9, 1, 1, 'Bộ ba số (a, b, c) là [i]bộ số Pi-ta-go[/i] nếu tổng bình phương của 2 số bằng bình phương của số còn lại. Câu lệnh nào sau đây để kiểm tra bộ số Pi-ta-go?', 1, '2014-12-07 13:34:16'),
(199, 11, 4, 12, 1, 1, 'Cho xâu [code]s:=''ABACBDB'';[/code] hàm [code]pos(''CB'',s)[/code] sẽ cho kết quả bằng mấy?', 1, '2014-12-08 05:37:36'),
